MR elastography estimates of hepatic stiffness (at 60 Hz) correlate with hepatic fibrosis stages as:
<2.5 kPa: Normal;
2.5 - 2.9 kPa: Normal or Inflammation;
2.9 - 3.5 kPa: Stage 1 to 2 Fibrosis;
3.5 - 4 kPa: Stage 2 to 3 Fibrosis;
4-5 kPa: Stage 3 to 4 Fibrosis;
>5 kPa: Stage 4 Fibrosis or Cirrhosis. (These are broad categories and results should be interpreted with clinical
and laboratory findings for other possible causes of increased liver stiffness.)
Reference: Venkatesh SK
